import React from "react";

const VideoList = (props) => {
    console.log()
    if (props.Response.data){
    const test = props.Response.data.items.map((item) => {
        return <img  src={item} />
    })
}

    return (
        <h1> {test} </h1>
    )
}

export default VideoList;
